,0,NULL,NULL,NULL,1,1,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(492,46,116,'Iogurte Nestlé  180g - Un',2.90,NULL,NULL,'b69226e370aed6cc757b6d22599f9be2.jpeg',NULL,0,0,0,NULL,NULL,NULL,0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(493,46,116,'banana prata kg',5.00,NULL,NULL,'003b1e336d15af09b11dc651ac0aecd4.jpeg',NULL,0,0,0,NULL,NULL,NULL,0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0),(494,123,118,'Manteiga de Amendoim Suply Life de R$ 20,00 por R$ 18,00',0.00,NULL,'Manteiga de amendoim.\r\nProduto ilustrativo, promoção  não  é  válida.','64208e82d6fba83b48ede4a58074f1c1.jpg','https://m.youtube.com/watch?v=Vf_25VBF6fo',0,0,0,NULL,'Pasta de Amendoim Adoçado com Agave Supply Life é um suplemento alimentar energético a base de amendoim queimado, com grãos de amendoim triturados. Uma deliciosa opção para a hora do lanche, que promoverá excelente energia a ser gasta nos treinos ou no dia-a-dia.\r\n\r\nCom sabor natural de amendoim torrado e sem adição de açúcar, é rica em fibras e Vitamina E, com pouco carboidrato, além de transformar-se em glicose lentamente, evita que o organismo tenha picos de insulina e proporcione uma energia gradual. Prolonga a saciedade do atleta, prevenindo o acúmulo de gorduras. Sem adição de açúcar, com matéria prima de qualidade. Contém boas doses de minerais, como ferro, zinco e magnésio.\r\n\r\n \r\n\r\nBenefícios:\r\n\r\nAntioxidante;\r\n\r\nEnergia prolongada;\r\n\r\nVitaminas e Minerais;\r\n\r\nPouco carboidrato;\r\n\r\nEvita picos de insulina;\r\n\r\nDelicioso sabor crocante;\r\n\r\nSem adição de açúcar.\r\n\r\n \r\n\r\nSugestão de uso:\r\n\r\nConsumir de uma a duas colheres de sopa por dia (aproximadamente 30g), de preferência no final da tarde.\r\n\r\n \r\n\r\nIngredientes: \r\n\r\nAmendoim torrado. Não contém Glúten. Não contém lactose.\r\n\r\n*ANVISA: Registro ISENTO NO MINISTÉRIO DA SAÚDE conforme resolução RDC 27 de 06 de Agosto de 2010 anexo 1.',NULL,19,1,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1),(495,123,118,'Senhora  Pipoca 200g',15.00,NULL,'Pipoca whey + chocolate','95653a162c526e9fb05080b59af260aa.jpg',NULL,0,0,0,NULL,'As pipocas da Senhora Pipoca tem um toque saudável, com gosto único, feita artesanalmente e com sabores surpreendentes. O milho é estourado no ar quente (sem óleo) e levam ingredientes de alta qualidade. Além disso, não possuem adição de conservantes ou aromatizantes!\r\n\r\nUma ótima opção saudável deliciosa que pode consumida em casa, no trabalho, dentro do carro preso no trânsito, antes da academia, dentro do avião, na praia ou vendo a sua série favorita.',NULL,3,1,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(496,123,120,'Top whey Max Titanium',256.00,NULL,'Whey protein.','b67f9056be2e5a57c9df19822d1ebdfd.jpg',NULL,0,0,0,NULL,'- Top Whey 3W é o mais completo, contém proteína do soro do leite concentrada (WPC), proteína do soro do leite isolada (WPI) e proteína do soro do leite hidrolisado (WPH), de absorção rápida e fácil digestão.\r\n\r\n- Top Whey 3W REFIL é o mais novo lançamento da Max Titanium.\r\n\r\n- Além disso conta com aminoácidos essenciais, é rico em BCAAs e Glutamina.\r\n\r\n- Por estes motivos o Top Whey 3W auxilia na construção de músculos e reparação de pequenos traumas.\r\n\r\n- Com uma quantidade maior de proteína por dose (24g), os resultados obtidos com o uso de Top Whey 3W são ainda melhores!\r\n\r\n- E visando melhorar ainda mais os benefícios, o produto ainda conta com quantidade reduzida de carboidratos.\r\n\r\n- Como a proteína é um nutriente que auxilia no aumento do metabolismo e na aceleração da queima de gordura, a ingestão de Top Whey 3W é benéfica tanto para quem quer construir massa muscular como para quem quer apenas tonificar.',NULL,2,1,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(497,123,83,'Bônus  de R$ 5 ,00',0.00,NULL,'Cupom promocional exemplificativo.','fdfe6062457832eecd04f29f5b432936.png',NULL,0,0,1,NULL,'Esse cupom é  válido  para compras acima de R$ 50,00.',NULL,13,1,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1),(498,124,119,'Pneu Novo  Ira 9/90x18 à partir de',85.00,NULL,'pneu tras. titan/ybr','5a1bbd412360e5df607612b3eee663ea.jpg',NULL,0,0,0,NULL,NULL,NULL,1,1,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(499,124,119,'Pneu 80/100×14 -Tras. Biz à  partir de',76.00,NULL,NULL,'f9a216d1a4989808fa55a14eb0ef5f9a.jpg',NULL,0,0,0,NULL,'Pneu  traseiro  Biz.',NULL,0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(500,124,119,'Lona de Freio/ Titan/ Biz/Broz',9.90,NULL,NULL,'58c097b636f0b8d6facc7619a2c7abc9.jpg',NULL,0,0,0,NULL,'Lona de freio biz/broz/titan',NULL,0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(501,124,119,'Bateria Moura  5H à partir de',165.00,NULL,'Imagem ilustrativa.','536fca56d78b28f5b365d8645e10c507.jpg',NULL,0,0,0,NULL,'Bateria moura 5H.',NULL,0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(502,124,119,'Bateria Moura 6H à partir  de',125.00,NULL,NULL,'bdaf3128597c8af4558c461d09483e00.jpg',NULL,0,0,0,NULL,'Bateria Moura 6H.',NULL,0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(503,124,119,'Óleo  4T 1220w50',8.90,NULL,NULL,'6ab2bdba7f7fb10110eb3a5e588b0f25.jpg',NULL,0,0,0,NULL,'Óleo  4T.',NULL,0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(504,122,120,'Jacaré pelúcia',15.00,NULL,NULL,'79fecab3b986fdd0268e0e700ac4cac0.jpg',NULL,0,0,1,NULL,NULL,NULL,4,1,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NUL